icides_per_100k, color = sex)) +\n    geom_line() +\n    geom_point() +\n    labs(title = \"Suicide Rate by Sex (Last 20 Years)\", x = \"Year\", y = \"Suicides per 100k\")+\n    scale_x_continuous(breaks = seq(1996, 2016, 2), minor_breaks = F)\n\nsex_bar_plot <- ggplot(df_by_sex, aes(x = sex, y = avg_suicides_per_100k, fill = sex)) +\n      geom_bar(stat = \"identity\") +\n      labs(title = \"Average Suicides per 100k by Sex\", x = \"Sex\", y = \"Average Suicides per 100k\")\n\ngrid.arrange(\n    sex_time_plot, sex_bar_plot,\n    ncol = 2, widths = c(20, 10)\n)\n","metadata":{"execution":{"iopub.status.busy":"2023-04-18T21:02:48.248097Z","iopub.execute_input":"2023-04-18T21:02:48.249618Z","iopub.status.idle":"2023-04-18T21:02:48.890376Z"},"trusted":true},"execution_count":75,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AU1doH8OfMbE022fTeG6F3lCaiotj1ivWq6FV5vYKIDbuC2PAqKogNe0O9\ndgW9WK6KWK70XpOQ3ututs7M+2FIWDabsEl2d5LN//cFdjI755k5u3OePTPnDJMkiQAAAACg\n/+OUDgAAAAAAfAOJHQAAAECQQGIHAAAAECSQ2AEAAAAECSR2AAAAAEECiR0AAABAkEBiBwAA\nABAkkNgBAAAABIl+mdgJ1uLXHr9txqQRsZHhapUmPDpp7MnnPbDioyahJ5Mtb7pnFGPszJ/L\nfbv+M9mRjLG1DdYehORqaKiGdcBxqrCI2NFTz3rk1XViLwvohZuTwxhjey1OP23ftxXdY/am\n37L16ke21skvzRUrGWM645RAxqCU/a9fwBjjeN3qMrPHFSRn46lResbY4DlrAhzbMWGI5vPj\nQi98aaeCMcBAJonmvBANY4zjNRtNDqXDUYYPz9jdbZe9f4uvmua+rP8ldqbiNSem5V9/7zM/\n/LlPHZE0dtyoFKO45ZevH5l/afrg8/9qtisdoF/EZ2bnuMhMT+YtDVt//eaBG84YfsWL3d2a\nJJo3bNjw58YSf4TqK32nop87Z5Zp2GP3j4oOWIntvK+pvWtfuvqcySnx0Vq1PjZ50HmzF/5U\nZOq4WvOhH+ZdfnpqXIQmNHLQhJlL3l7f9Wbzrv14To5REm3zz37M4wrbnjnvxwarOnT42uUz\nvdkjP2Fc6IsfXfnV/FPWB+kZAPq4uh13H7A4iEgSHQs/LVI6HAX0nTM2kNS/iLaLkwxElD/r\ngZ2Vre2L6/at/7+piUQUPeLO7m6ydtOXb7755ncuW/PJ+suyIohoTb2lu/G4GRKiJqL3qs1u\ny0Vn00dLLpAr8dGDjd3apt20mYjC0x7oZWzzkgxEtKfV0cvteOCHiu6Z2u2LiGjp/ob2Jaby\n54lIGz45AKV7WVPrHjqSVMXkjpgycXSsQU1EvDbphY01rqtV/29lrJonosjMIeNHD9FyjIhO\nmL+66403Fbym4RgRzf2utGN4yVqeiC5bfagHe+drz