geom_smooth(method = \"lm\", se = FALSE) +\n  labs(title = \"Suicides per 100k vs GDP per Capita by Sex\", x = \"GDP per Capita\", y = \"Suicides per 100k\", color = \"Sex\")","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# Filter data for last 10 years\nlast_10_years <- data %>% filter(year >= 2011)\n\n# Compute total suicides by sex\ntotal_suicides_by_sex <- last_10_years %>%\n  group_by(sex) %>%\n  summarize(total_suicides = sum(suicides_no))\n\n# Create bar chart\nggplot(total_suicides_by_sex, aes(x = sex, y = total_suicides, fill = sex)) +\n  geom_bar(stat = \"identity\", alpha = 0.8) +\n  labs(title = \"Total Suicides in Last 10 Years by Sex\", x = \"Sex\", y = \"Total Suicides\") +\n  scale_fill_manual(values = c(\"red\", \"blue\"))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Continent\ndata$continent <- countrycode(sourcevar = data[, \"country\"],\n                              origin = \"country.name\",\n                              destination = \"continent\")","metadata":{}},{"cell_type":"code","source":"library(countrycode)\n\ndata$continent <- countrycode(sourcevar = data[, \"country\"],\n                              origin = \"country.name\",\n                              destination = \"continent\")","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Modeling Section","metadata":{}},{"cell_type":"code","source":"# create linear regression model\nmodel <- lm(suicides_per_100k ~ gdp_per_capita, data = df)\n\n# print model summary\nsummary(model)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# calculate change in GDP from year to year for each country\ndf <- df %>%\n  group_by(country) %>%\n  mutate(gdp_change = gdp_per_capita - lag(gdp_per_capita))\n\n# filter for countries whose GDPs dropped\ndf_dropped <- df %>% filter(gdp_change < 0)\n\n# create scatter plot with regression line\nggplot(df_dropped, aes(x = gdp_change, y = suicides_per_100k)) +\n  geom_point() +\n  geom_smooth(method = \"lm\") +\n  labs(x = \"Change in GDP\", y = \"Suicides per 100k\")","metadata":{"trusted":true},"execution_count":null,"outputs":[]}]}